import React from "react";
import { NavLink } from "react-router-dom";
import Header from "../components/Header";
import Navbar from "../components/NavBar";

const Start = () => {
  const mentalHealthIssues = [
    { id: 1, name: "Anxiety", path: "/get-started" },
    { id: 2, name: "Depression", path: "/depression" },
    { id: 3, name: "Bipolar Disorder", path: "/bipolar-disorder" },
    { id: 4, name: "Eating Disorders", path: "/eating-disorders" },
    { id: 5, name: "PTSD", path: "/ptsd" },
    { id: 6, name: "OCD", path: "/ocd" },
    { id: 7, name: "ADHD", path: "/adhd" },
    { id: 8, name: "Schizophrenia", path: "/schizophrenia" },
    { id: 9, name: "Borderline Personality Disorder", path: "/bpd" },
    { id: 10, name: "Substance Abuse", path: "/substance-abuse" },
    { id: 11, name: "Autism Spectrum Disorder", path: "/autism" },
    { id: 12, name: "Dementia", path: "/dementia" },
  ];

  return (
    <div>
      <Navbar />
      <Header
        title={"Free Mental Health Assessments"}
        description={
          "Join our community and get access to exclusive content on mental wellness. Take a Free test and get Your Report."
        }
      />
      <ul>
        {mentalHealthIssues.map((issue) => (
          <li key={issue.id}>
            <NavLink to={issue.path}>{issue.name}</NavLink>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Start;
